import './HorzBox.css';

function HorzBox() {
    return (
        <div className="horzBox">
            <form>
                <div id="buyOrSell">
                    <p className="active buy">Buy</p>
                    <p className="sell">Sell</p>
                </div>
                <select id="currBalance">Bal</select>
            </form>


        </div>
    )
}

export default HorzBox
